import React, { Component } from "react";
import { OwpButton, OwpSearchDateField, OwpSearchSelectField, OwpSearchTextField, OwpTextField } from 'owp/wrapper';
import Formsy from "formsy-react";
import * as TGEvent from 'owp/TGEvent';
import moment from "moment";
import { query } from 'owp/api';
import DextEditor from "main/custom-component/DextEditor"

class Page extends Component {
    constructor(props) {
        super(props);
        this.state = {

        };
    }
    /**
     * Owp에서 사용하는 인풋에 대해 모두 사용할 수 있는 change 이벤트 리시버
     * @param {Event} event 발생한 이벤트 객체
     * @param {Function} callback 콜백 함수. 인풋의 name, value를 인수로 전달함.
     */
    componentDidMount() {
        const _showApprovalDialog = this.showApprovalDialog;
    }

    //날짜 디폴드값 설정 함수

    render() {
        return (
            <React.Fragment>
                <div style={{ width: '100%' }}>
                    <div className="row">
                        <div className="col-md-12">
                            <div className="b">General Inst</div>
                            <div className="dsbbox ovflowy mgt10">
                                <div className="row">
                                    <div className="col-md-12" style={{ textAlign: 'left' }}>
                                        <DextEditor
                                            height="330px"
                                            onRef={ref => this.Editor = ref}
                                            value={"<p>※&nbsp;본&nbsp;문서는&nbsp;공정진행&nbsp;시&nbsp;주의해야&nbsp;할&nbsp;사항&nbsp;등이&nbsp;자세히&nbsp;기록되어&nbsp;있으므로&nbsp;운전을&nbsp;진행하기&nbsp;전에&nbsp;본&nbsp;문서를&nbsp;반드시&nbsp;읽고&nbsp;확인&nbsp;및&nbsp;숙지할&nbsp;것.&nbsp;<br>(Read&nbsp;and&nbsp;be&nbsp;fully&nbsp;aware&nbsp;of&nbsp;cautions&nbsp;described&nbsp;in&nbsp;the&nbsp;batch&nbsp;record&nbsp;before&nbsp;production.)<br><br>1.&nbsp;&nbsp;&nbsp;&nbsp;최초의&nbsp;시운전&nbsp;절차<br>1.1&nbsp;&nbsp;&nbsp;&nbsp;Utility<br>-&nbsp;&nbsp;&nbsp;&nbsp;공급되는&nbsp;Utility가&nbsp;정상적인지&nbsp;확인&nbsp;후&nbsp;필요한&nbsp;Utillity&nbsp;관련&nbsp;설비를&nbsp;작동하고,&nbsp;Utilty&nbsp;장비&nbsp;운전에&nbsp;대한&nbsp;자세한&nbsp;내용은&nbsp;각&nbsp;장비들의&nbsp;운전&nbsp;Manual을&nbsp;참조함.<br>(After&nbsp;checking&nbsp;the&nbsp;operation&nbsp;status&nbsp;of&nbsp;the&nbsp;utility,&nbsp;refer&nbsp;to&nbsp;each&nbsp;operation&nbsp;manual&nbsp;and&nbsp;operate&nbsp;the&nbsp;utility<br>&nbsp;equipment)<br>-&nbsp;&nbsp;&nbsp;&nbsp;K4&nbsp;Utility&nbsp;:&nbsp;Steam(7.0~8.0&nbsp;KG),&nbsp;Potable&nbsp;Water(4.0~5.5&nbsp;KG),&nbsp;Air(5.0~7.0&nbsp;KG),&nbsp;Emergency&nbsp;generator&nbsp;(1000&nbsp;KW),&nbsp;Electric&nbsp;Power(6.6&nbsp;KV)<br>-&nbsp;&nbsp;&nbsp;&nbsp;Local&nbsp;Utility&nbsp;:&nbsp;Scrubber(450&nbsp;cmm),&nbsp;냉각탑(3.0&nbsp;KG,&nbsp;800RT&nbsp;X&nbsp;2EA),&nbsp;냉동기(-20&nbsp;℃&nbsp;이하,&nbsp;150RT&nbsp;X&nbsp;2EA),&nbsp;TCU&nbsp;System(5.0&nbsp;KG&nbsp;이하),&nbsp;LN2(2.0~8.0&nbsp;KG)<br>1.2&nbsp;&nbsp;&nbsp;&nbsp;제조&nbsp;공정&nbsp;교육&nbsp;&nbsp;(Training)<br>-&nbsp;&nbsp;&nbsp;&nbsp;공정&nbsp;안전운전&nbsp;절차(EHS01200)&nbsp;및&nbsp;관련해&nbsp;작성&nbsp;된&nbsp;Batch&nbsp;Record(이하&nbsp;B/R)&nbsp;교육을&nbsp;실시함.<br>(The&nbsp;production&nbsp;manager&nbsp;should&nbsp;train&nbsp;all&nbsp;operators&nbsp;about&nbsp;safety&nbsp;operation&nbsp;procedure&nbsp;(EHS01200)&nbsp;and&nbsp;Batch&nbsp;<br>Record)<br>-&nbsp;&nbsp;&nbsp;&nbsp;공정에&nbsp;사용&nbsp;되는&nbsp;원료&nbsp;및&nbsp;제품의&nbsp;MSDS&nbsp;를&nbsp;확인하여&nbsp;취급&nbsp;시&nbsp;주의&nbsp;사항&nbsp;및&nbsp;유해&nbsp;위험성에&nbsp;대해&nbsp;교육을&nbsp;실시함.<br>(The&nbsp;production&nbsp;manager&nbsp;should&nbsp;train&nbsp;MSDS&nbsp;of&nbsp;the&nbsp;raw&nbsp;materials,&nbsp;the&nbsp;intermediates&nbsp;and&nbsp;the&nbsp;products&nbsp;before&nbsp;<br>production)<br>-&nbsp;&nbsp;&nbsp;&nbsp;설비의&nbsp;가동과&nbsp;관련한&nbsp;절차&nbsp;및&nbsp;주의&nbsp;사항에&nbsp;대해&nbsp;교육을&nbsp;실시함.<br>(The&nbsp;production&nbsp;manager&nbsp;should&nbsp;train&nbsp;operation&nbsp;procedures&nbsp;and&nbsp;precautions&nbsp;of&nbsp;process&nbsp;equipments)<br>1.3&nbsp;&nbsp;&nbsp;&nbsp;운전&nbsp;절차&nbsp;(Operation)<br>-&nbsp;&nbsp;&nbsp;&nbsp;운전은&nbsp;원료&nbsp;투입,&nbsp;온도&nbsp;조절,&nbsp;반응,&nbsp;농축&nbsp;또는&nbsp;Reflux,&nbsp;냉각,&nbsp;이송&nbsp;및&nbsp;여과,&nbsp;건조,&nbsp;포장,&nbsp;용매&nbsp;폐기,&nbsp;사용&nbsp;설비의&nbsp;세척&nbsp;순으로&nbsp;진행&nbsp;되면,&nbsp;세부절차는&nbsp;관련한&nbsp;절차를&nbsp;확인하여&nbsp;진행함.<br>(The&nbsp;production&nbsp;proceeded&nbsp;according&nbsp;to&nbsp;charge,&nbsp;temperature&nbsp;control,&nbsp;reaction,&nbsp;concentration&nbsp;or&nbsp;reflux,&nbsp;cooling,<br>filtration,&nbsp;drying,&nbsp;packing,&nbsp;discard,&nbsp;cleaning&nbsp;and&nbsp;detail&nbsp;procedure&nbsp;described&nbsp;in&nbsp;SOP)<br><br>2.&nbsp;&nbsp;&nbsp;&nbsp;정상&nbsp;운전&nbsp;(Normal&nbsp;Operation&nbsp;Procedure)<br>2.1&nbsp;&nbsp;&nbsp;&nbsp;제조&nbsp;공정&nbsp;(Production)<br>-&nbsp;&nbsp;&nbsp;&nbsp;정상&nbsp;운전은&nbsp;작성&nbsp;된&nbsp;B/R&nbsp;의&nbsp;세부절차에&nbsp;따라&nbsp;운전함.&nbsp;<br>(Detail&nbsp;procedure&nbsp;follow&nbsp;the&nbsp;B/R)<br>2.2&nbsp;&nbsp;&nbsp;&nbsp;설비&nbsp;운전&nbsp;(Operation&nbsp;of&nbsp;equipment)<br>-&nbsp;&nbsp;&nbsp;&nbsp;각&nbsp;설비의&nbsp;운전&nbsp;절차에&nbsp;따라&nbsp;운전함.<br>(All&nbsp;of&nbsp;equipment&nbsp;follow&nbsp;each&nbsp;operating&nbsp;procedure)</p>"} // 동적 세팅 가능
                                        />
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </React.Fragment>
        );
    }
}

export default Page;
